import { createStyles } from "@mantine/core";

export const useStyles = createStyles((theme, _params, getRef) => ({
  radioWrapper: {
    marginTop: `${theme.spacing.sm}px`,
  },
  breadcrumbWrapper: {
    marginTop: `${theme.spacing.sm}px`,
  },
}));
